import React from 'react';

const Header = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark mb-4">
      <div className="container-fluid">
        <span className="navbar-brand">Shipping Manager Dashboard</span>
      </div>
    </nav>
  );
};

export default Header;
